import React, { Fragment } from "react";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";

import Header from "./components/headerComponents/header";
import Navigation from "./components/navComponents/Navigation";
import Container from "./components/mainContainer/Container";

import "./App.css";

const App = () => {
  return (
    // <Fragment>

    //   <Container />
    // </Fragment>
    <BrowserRouter>
      <Routes>
        <Route
          path="/"
          element={
            <Fragment>
              <Header />
              <Navigation />
              <Container mode={"list"} />
            </Fragment>
          }
        />
        <Route path="/list" element={<Container mode={"list"} />} />
        <Route path="/form" element={<Container mode={"form"} />} />
      </Routes>
    </BrowserRouter>
  );
};

export default App;
